import React from 'react';
import {useSelector} from "react-redux";
import {ListGroup} from "react-bootstrap";


const TypeBar = () => {
    const {isTypes} = useSelector(state => state.deviceReducer)

    return (
        <ListGroup>
            {isTypes.map(type =>
                <ListGroup.Item key={type.id}>
                    {type.name}
                </ListGroup.Item>
            )}
        </ListGroup>
    );
};

export default TypeBar;
